function exportHorarioSala() {
     let doc = new jsPDF();
     let imgData = 'data:image/jpeg;base64,';
     let sala = $('#sala')[0];
     console.log(sala);
     $('#horarioSalaTable').addClass('export-table');

     doc.addImage(imgData, 'JPG', 25, 5, 160, 18);
     console.log(doc);
     doc.line(14, 25, 196, 25);
     doc.fromHTML(sala, 14, 25);
     doc.autoTable({
         html: '#horarioSalaTable',
         margin: {top: 45},
         useCss: true,
         didDrawPage: function (data) {
             var str = "Página " + doc.internal.getNumberOfPages();
              if (typeof doc.putTotalPages === 'function') {
                  str = str;
              }
             doc.setFontSize(10);
             doc.text(100, 290, str);
         }
     });
    
     doc.setFontSize(11);
     doc.text(14, 250, 'Ing. Edgar F. Montaluisa P. MSc.');
     doc.text(14, 255, 'JEFE DE LABORATORIO DE REDES E INFORMÁTICA');
     doc.line(14, 285, 196, 285);
    
     doc.setFontSize(10);
     doc.text(14, 290, 'SG-LAB');
     doc.text(178, 290, moment().format('DD-MM-YYYY'));
    
      // doc.save('reporteHorarioSala.pdf');
     doc.output('dataurlnewwindow');
     $('#horarioSalaTable').removeClass('export-table');
}

